  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent implements OnInit {

  constructor(private dataService: DataServiceService) {}

  ngOnInit() {
    this.dataService.checkAuth();
  }
}
